import React, { useEffect, useState } from 'react';
import axios from 'axios';
import '../CSS/Style.css';
import {Link,useParams} from "react-router-dom";

function Category() {

    const [categories,setCategories]=useState([]);



    const Product=()=>{

        axios.get(`https://fakestoreapi.com/products/categories`)
        .then((response)=>{
            console.log(response);

            setCategories(response.data)
        })
    }
  return (
    <>
       <div className='category'>
       <h2 className='Heading'>Flipkart Lite <img src='https://icon-library.com/images/trolley-icon/trolley-icon-8.jpg' alt='#' className='logo'></img></h2>
       <button className='button' onClick={Product}>categor</button>

       <div>
           <>
           {/* <Link to={`/categories[${no}]`}>
           <p>{categories[0]}</p><br></br></Link> */}
