             <p>{categories[0]}</p><br></br>
             <p>{categories[1]}</p><br></br>
             <p>{categories[2]}</p><br></br>
             <p>{categories[3]}</p><br></br>
           </>

        </div>   
       </div>
    </>
  );

}

export default Category;
